import React from "react";
import { Modal, Row } from "bootstrap";

const CurdEditChanges = ({ show, handleClose, state }) => {
    return (
        <>
            {
                show ? (
                    <Modal>
                        <Modal.Header>
                            <Modal.Title>Modal heading</Modal.Title>
                        </Modal.Header>
                    </Modal>
                ) : ""
            }
        </>
    )
}
export default CurdEditChanges;
